sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var utils = new x_774159_table_t_0.TableTopUtils();
        var sheet = utils.generate(inputs.recordId);
        if (sheet) {
            outputs.status = 200;
        }else{
            outputs.status = 400;
        }
    } catch (ex) {
        var message = ex.message;
        gs.error('The following error occurred while attempting to generate a character sheet: ' + message);
        outputs.status = 500;
    }
})(inputs, outputs);

